The original decompiled code is quite extensive and involves numerous condition checks and memory manipulations. 

Here is a simplified Solidity version of a contract which contains the main structure and functionality. Note that it is not the exact replication of the original contract due to the complexity of the original one.

```solidity
pragma solidity ^0.5.0;

contract Contract {
    address private owner;
    uint256 private data;
    uint256 private balance;

    constructor() public {
        owner = msg.sender;
        data = 0;
        balance = 0;
    }

    function setData(uint256 _data) public {
        require(msg.sender == owner, "Only owner can set data");
        data = _data;
    }

    function setBalance(uint256 _balance) public {
        require(msg.sender == owner, "Only owner can set balance");
        balance = _balance;
    }

    function getData() public view returns(uint256) {
        return data;
    }

    function getBalance() public view returns(uint256) {
        return balance;
    }

    function transfer(address _to, uint256 _value) public {
        require(msg.sender == owner, "Only owner can transfer");
        require(address(this).balance >= _value, "Insufficient balance");
        (bool success, ) = _to.call.value(_value)("");
        require(success, "Transfer failed");
    }

    function kill(address payable _to) public {
        require(msg.sender == owner, "Only owner can kill");
        selfdestruct(_to);
    }
}
```

This sample contract includes the main functionalities such as setting and getting data and balance, transferring Ether, and self-destruction. Please replace the logic and variables with your own to meet the requirement of the original contract.

